import React from 'react';
import Input from './Input';

function Skills() {
  return (
    <div>
      <div>
        <h1>
          <b>Skills</b>
        </h1>
      </div>
      <ul>
        <li>
          <p>
            <b>{<Input name="skill" />} </b> {<Input name="skills" />}
          </p>
        </li>
      </ul>
    </div>
  );
}

export default Skills;
